import React from "react";
import styled from "styled-components";

export default function SideNav(props) {
  return (
    <MainContainer>
      <ul>
        <li
          onClick={() => {
            props.change("INBOX");
          }}
        >
          <div>Inbox</div>
        </li>
        <li
          onClick={() => {
            props.change("TODAY");
          }}
        >
          <div>Today</div>
        </li>
        <li
          onClick={() => {
            props.change("NEXT");
          }}
        >
          <div>Next 7 Days</div>
        </li>
      </ul>
    </MainContainer>
  );
}

const MainContainer = styled.div`
  border: 2px solid crimson;
  li {
    font-size: 1.3rem;
    text-align: center;
    font-family: "Open Sans", sans-serif;


  }
`;
